;; **
;;; TBA: calculating normalised mutual information (and time to run) between inference results without and with conjugacy with the same amount of particles.
;; **

;; @@
(defn log2 [n]
  "calculates the logarithm with base 2"
  (/ (Math/log n) (Math/log 2)))

(defn sum [seq]
  "calculates the sum of elements in the sequence"
  (reduce + seq))

;; Based on
;; http://nlp.stanford.edu/IR-book/html/htmledition/evaluation-of-clustering-1.html
(defn calc-entropy
  [data]
  "calculates entropy of the data sequence"
  (let
    [freq (frequencies data)
     N (count data)]
    (-
     (sum (map (fn [count] (* (/ count N) (log2 (/ count N)))) (vals freq))))))

(defn calc-intersection-factor
  [intersection-count k-count j-count N]
  "calculates one sum element for the mutual information"
  (if (nil? intersection-count)
    0
    (*
     (/ intersection-count N)
     (log2 (/ (* N intersection-count) (* k-count j-count))))))

(defn calc-mi
  [seq-test seq-true]
  "calculates mutual information of two data sequences"
  (let
    [seq-test-freq (frequencies seq-test)
     seq-true-freq (frequencies seq-true)
     seq-test-true (map (fn [k j] (list k j)) seq-test seq-true)
     seq-test-true-freq (frequencies seq-test-true)
     N (count seq-test)]
    (sum
     (map
      (fn [k]
        (sum (map (fn [j]
                    (calc-intersection-factor
                     (get seq-test-true-freq (list k j))
                     (get seq-test-freq k)
                     (get seq-true-freq j)
                     N

                     )) (keys seq-true-freq))))
      (keys seq-test-freq)))))

(defn calc-nmi
  [seq-test seq-true]
  "calculates the normalised mutual information"
  (/ (calc-mi seq-test seq-true)
     (/ (+ (calc-entropy seq-test) (calc-entropy seq-true)) 2)))
