(defn average [seq]
  "calculates the average for the sequence"
  (/ (sum seq) (count seq)))

(defmacro get-evaluation-result-and-time [expression]
  "Returns an amount of time and result of an evaluation of an expression"
  `(let
    [start-time# (System/currentTimeMillis)
     eval-result# (doall ~expression)]
    (list (- (System/currentTimeMillis) start-time#) eval-result#)))

